import './App.css';
import React from 'react'; 
import Navbar from './Navbar';
import Home from './Home';
/*
  The App component is the root component of our application.
  It is the parent of all other components.
  It is the first component that gets rendered when our application loads.
  It is the component that gets rendered when we go to the root URL of our application
  <Navbar /> is self closing tag
*/

function App() {
  return(
  <div className="App">
    <Navbar />          
    <div className="content">
      <Home />
    </div>
  </div>
  );
}

export default App;
